import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';
import {
  PostTextStyled,
} from 'components/Style/Post'
import hljs from 'highlight.js';
import { Link } from 'react-router-dom';
import marked from 'marked';

const HomeStyled = styled.div`
  flex: 1;
  /* display: flex;
  flex-wrap: wrap; */
`;

const PostPreview = styled.div`
  position: relative;
  margin: 10px 10px 30px 40px;
  padding: 10px 20px 35px;
  border-radius: 3px;
  overflow: hidden;
  box-shadow: 0px 10px 5px 0px rgba(240,240,240,0.8);
  transition: box-shadow 0.3s ease-in-out 0s; 

  &:hover{
    box-shadow: 0px 10px 5px 0px rgba(225,225,225,0.8);
  }

  img{
    max-width: 500px;
    max-height: 300px;
  }
`;

const Title = styled(Link)`
  display: inline-block;
  font-size: 1.7rem;
  padding: 10px 0;
  letter-spacing: 0.1em;
`;

const DateTime = styled.div`
  padding: 0.8em 0 0.55em;
  color: #777;
  font-size: 0.8em;
`;

const TagUl = styled.ul`
  margin-bottom: 0.5em;
`;

const Tag = styled.li`
  display: inline-block;
  border: 1px solid #8dc2c2;
  padding: 5px 5px;
  border-radius: 2px;
  font-size: 0.75em;
  color: #61a3a3;
  margin: 0 2px;
`;

const ContinueRead = styled(Link)`
  /* position: absolute;
  bottom: 20px;
  right: 20px;
  border: 0px;
  background: #fff;
  color: #61a3a3; */
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  border: 0px;
  padding: 8px;
  font-size: 0.8em;
  background: #fff;
  color: #61a3a3;
  transition: 0.3s ease-in-out 0s; 
  letter-spacing: 0.1em;
  text-align: center;

  &:hover{
    background: #8dc2c2;
    color: #fff;
  }
`;

const Home = ({
  postList,
  md
}) => {
  let postItems = postList.slice().reverse().map((post,index)=>{
    let tagItems = post.tags.map(tag=>(
      <Tag key={tag}>{tag}</Tag>
    ))
    return (
      <PostPreview key={post.id}>
        <TagUl>{tagItems}</TagUl>
        <Title to={`/blog/post/${post.id}`}>{post.title}</Title>
        <DateTime>{post.datetime}</DateTime>
        {post.img? <img src={post.img} alt='post img'></img> : null}
        <PostTextStyled>
          <span>[韓文文法]未來式-(으)ㄹ 거예요 vs -(으)ㄹ게요</span>
2020.01.16
V/A-(으)ㄹ 거예요 會、要、打算
變化規則：
動詞、形容詞：
有尾音：+ㄹ 거예요
無尾音：+을 거예요
ㄹ：살다 → 살 거예요
ㄷ：듣다 → 들을 거예요
ㅅ/ㅂ：돕다 → 도을 거예요

📌表達未來的計劃或意圖
主語為第一或第二人稱。
不能是形容詞。
例句：
저는 주말에 났시를 할 거예요.　我週末要去釣魚。
내년에 고향에 돌아갈 거예요.　(我)明年會回老家。


📌表達未來的推測
主詞可以為第三人稱。
可以是形容詞。
不能是問句
제가 다음주에는 좀 바쁠 거예요.　我下周應該會很忙。
（形容詞：所以是推測語氣）
동해는 오늘 느게 올 거예요.　東海今天可能會晚來
（第三人稱：所以是推測語氣）


V-(으)ㄹ게요 我要～、我會～
變化規則：同上
📌表達說話者的決心、意願
📌與他人做約定時
著重在你的行為或決定是根據他人所說的話而做出來的反應或結果。

只能用於第一人稱。
不能用於問句。
不能用於形容詞。
例句：
제가 전화 받을게요.　我來接電話。
저는 이제부터 날씬할게요.　現在開始要減肥。
A：제 잡지를 가지고 왔어요?　你有帶我的雜誌來嗎？
B：잊어버렸어요! 내일은 꼭 가지고 올게요.　我忘記了！明天一定帶來。（與他人約定）
이제 늦지 않을게요.　現在還不晚（不能與形容詞合用）


比較 (으)ㄹ 거예요 和 (으)ㄹ게요
📌공부할 거예요.　我要讀書。
        </PostTextStyled>
        {/* <PostTextStyled
          id="content"
          className="article-detail"
          dangerouslySetInnerHTML={{__html: md[index]? marked(md[index]): ''}}
        /> */}
        <ContinueRead to={`/blog/post/${post.id}`}>CONTINUE READING...</ContinueRead>
      </PostPreview>
    )
  })
  return (
    <HomeStyled classNameName='container'>
      {postItems}
    </HomeStyled>
  );
};;

Home.propTypes = {
  postList: PropTypes.array.isRequired,
  md: PropTypes.array.isRequired,
};

export default Home;
